sys_variable_value.value:
(function execute(inputs, outputs) {
var did = inputs.domSysID;

var agg = new GlideAggregate('x_snc_domain_man_0_domain_rel_table');
agg.addAggregate('COUNT', 'create_date');
agg.addAggregate('SUM', 'record_count');
agg.addQuery('domain=' + did);
agg.query();
while (agg.next()) {
    //do things on the results
    var tableCount = agg.getAggregate('COUNT', 'create_date');
    var recordSum = agg.getAggregate('SUM', 'record_count');
    //gs.info('Display the count {0}', [recordSum]);
    //outputs.newcount = recordSum;
}



outputs.table_count = tableCount;
outputs.record_sum = recordSum;

})(inputs, outputs);

